import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for product cards to load
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Get all available product cards
    const productCards = await page.$$('.product-card');
    console.log(`Found ${productCards.length} product cards`);

    // Rapid cart manipulation - add multiple items quickly
    const cartActions = [];
    const maxItems = Math.min(5, productCards.length); // Add up to 5 items

    for (let i = 0; i < maxItems; i++) {
      try {
        // Click Add to Cart button
        const addButton = await productCards[i].$('.add-to-cart');
        if (addButton) {
          await addButton.click();
          cartActions.push(`Added product ${i+1} to cart`);

          // Wait briefly between actions to simulate rapid interaction
          await page.waitForTimeout(200);
        }
      } catch (error) {
        console.log(`Could not add product ${i+1}: ${error.message}`);
      }
    }

    // Take screenshot after adding items
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_adding.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_adding.png'));

    // Open cart modal
    const cartElement = await page.$('.cart');
    if (cartElement) {
      await cartElement.click();
      await page.waitForSelector('#cartModal', { state: 'visible', timeout: 3000 });

      // Take screenshot of cart with items
      await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_open.png') });
      screenshots.push(path.join(screenshotsDir, 'step_3_cart_open.png'));

      // Rapidly remove some items from cart
      const removeButtons = await page.$$('.remove-item');
      const itemsToRemove = Math.min(2, removeButtons.length); // Remove up to 2 items

      for (let i = 0; i < itemsToRemove; i++) {
        try {
          await removeButtons[i].click();
          cartActions.push(`Removed item ${i+1} from cart`);

          // Wait briefly between removal actions
          await page.waitForTimeout(200);
        } catch (error) {
          console.log(`Could not remove item ${i+1}: ${error.message}`);
        }
      }

      // Take screenshot after removals
      await page.screenshot({ path: path.join(screenshotsDir, 'step_4_after_removals.png') });
      screenshots.push(path.join(screenshotsDir, 'step_4_after_removals.png'));

      // Close cart modal
      const closeButton = await page.$('.close');
      if (closeButton) {
        await closeButton.click();
      }
    }

    // Final screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_final.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_final.png'));

    // Extract cart count for verification
    const cartText = await page.$eval('.cart', el => el.textContent);
    const cartCount = parseInt(cartText.match(/\d+/)[0]) || 0;

    return {
      success: true,
      action: "Performed rapid cart manipulation stress test",
      extractedData: {
        cartActions: cartActions,
        finalCartCount: cartCount,
        itemsAdded: maxItems,
        itemsRemoved: Math.min(2, maxItems)
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete rapid cart manipulation stress test",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
